import React from 'react';
import './AboutMe.css';

function AboutMe() {
    return (
        <div className="aboutme">
            <p>
                I'm an aspiring Product Manager / Software Engineer currently residing in Southern California.
                <br></br>
                I enjoy creating mobile apps, designing beautiful layouts and learning about new products.
            </p>
        </div>
    );
}

export default AboutMe;
